import React, { useEffect, useRef, useCallback, useState } from 'react';
import { Helmet } from "react-helmet";
import { Navbar, Nav } from "react-bootstrap";
import 'bootstrap/dist/css/bootstrap.min.css';
import '../assets/css/animate.min.css';
import '../assets/css/aos.min.css';
import '../assets/fonts/font-awesome.min.css';
import Collapse from 'bootstrap/js/dist/collapse';
import AOS from 'aos';
import FeetLogo from "../assets/img/feet dreams logo fav white.webp";
import FeetText from "../assets/img/feet dreams logo text white.webp";
import 'aos/dist/aos.css';
import '../assets/css/style-font.css';



function NavComponent(paramDict) {

  return (
    <div>
    <Helmet>
    <body id="page-top" data-bs-spy="scroll" data-bs-target="#mainNav" data-bs-offset="77" data-aos-easing="ease" data-aos-duration="400" data-aos-delay="0" />
    </Helmet>
    <Navbar bg="light" expand="md" fixed="top">
      <Navbar.Brand href="index.html">
        <img
          src={FeetLogo}
          width="70"
          height="70"
          className="d-inline-block align-top"
          alt="Feet dreams logo"
        />
        <img
          src={FeetText}
          className="d-none d-sm-inline d-md-none d-lg-none d-xl-inline d-xxl-inline flex-shrink-1"
          alt="Feet dreams text"
        />
      </Navbar.Brand>
      <Navbar.Toggle aria-controls="responsive-navbar-nav" />
      <Navbar.Collapse id="responsive-navbar-nav">
        <Nav className="ms-auto">
          <Nav.Link href="#about">Qu'est-ce que c'est ?</Nav.Link>
          <Nav.Link href="#tarifs">Tarifs</Nav.Link>
          <Nav.Link href="#contact">Contact</Nav.Link>
          <Nav.Link href="#videos">Videos</Nav.Link>
          <Nav.Link href="/rendezvous" style={{backgroundColor: "#5c9688"}}>PRENDRE RENDEZ-VOUS</Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Navbar>
    </div>
  )
}

export default NavComponent;
